INSERT INTO `books` (`book_id`, `name`, `publisher`, `description`, `cover`, `path`) VALUES
(1, 'Matura 2015 Repetytorium Poziom podstawowy i rozszerzony', 'Macmillan', 'Matura 2015. Repetytorium to nieoceniona pomoc w przygotowaniach do nowej matury. Wyjątkowe połączenie treningu do matury podstawowej i rozszerzonej pozwala w trakcie jednej lekcji przygotować uczniów do dwóch poziomów matury. Repetytorium w przemyślany sposób uczy słownictwa, które rozwijane jest w każdej sekcji, oraz systematycznie rozwija umiejętności językowe w kontekście zadań egzaminacyjnych. Przygotowanie do egzaminu ułatwiają użyteczne banki zwrotów, modelowe wypowiedzi oraz zestawienie reguł gramatycznych. - Źródło: www.macmillan.pl', , './img/covers/03.png');
INSERT INTO `books` (`book_id`, `name`, `publisher`, `description`, `cover`, `path`) VALUES
(2, 'Oxford Solutions Intermediate', 'Oxford University Press', 'Kompleksowe przygotowanie do matury\r\nSekcja Skills Trainer w każdym rozdziale podręcznika\r\nSekcja Matura Skills Trainer w zeszycie ćwiczeń\r\nSekcja Word Skills w podręczniku przygotowująca do części matury Znajomość środków językowych (Use of English)\r\nCumulative Reviews w zeszycie ćwiczeń podsumowujące dotychczas przerobiony materiał\r\nDodatkowe wsparcie w postaci próbnych egzaminów maturalnych do pobrania\r\nŹródło: elt.oup.com', , './img/covers/04.jpg');
INSERT INTO `books` (`book_id`, `name`, `publisher`, `description`, `cover`, `path`) VALUES
(3, 'Macmillan repetytorium poziom rozszerzony języka angielski dla uczniów liceów i techników', 'Macmillan', 'Repetytorium dla uczniów liceów i techników. Poziom rozszerzony to nieoceniona pomoc w przygotowaniach do nowej matury na poziomie rozszerzonym. Repetytorium w przemyślany sposób uczy słownictwa, które rozwijane jest w każdej sekcji, oraz systematycznie rozwija umiejętności językowe w kontekście zadań egzaminacyjnych. Przygotowanie do egzaminu ułatwiają użyteczne banki zwrotów, modelowe wypowiedzi oraz zestawienie reguł gramatycznych. - Źródło: sklep.macmillan.pl', , './img/covers/05.png');
INSERT INTO `books` (`book_id`, `name`, `publisher`, `description`, `cover`, `path`) VALUES
