INSERT INTO `books` (`book_id`, `name`, `publisher`, `description`, `cover`, `path`) VALUES
(5, 'New Matura Success Pre-intermediate', 'Pearson', 'New Matura Success to bestsellerowy kurs dla szkół ponadgimnazjalnych. Inspirujące teksty, zdjęcia oraz filmy zostały dobrane w taki sposób, aby każdy licealista mógł identyfikować się z poruszanymi w podręczniku zagadnieniami.\r\n\r\nWydanie uaktualnione do matury 2015 - My Matura Success - pozwala skutecznie przygotować się do nowego formatu egzaminu. - Źródło: pearson.pl', , './img/covers/01.jpeg');

